pragma solidity ^0.8.3;

contract Oracle {
    struct AuthenticityBallot {
        uint16 authenticityRating;
        uint genesisFunding;
        uint32 commitEnd;
        uint32 revealEnd;
        bool exists;
    }
    mapping(uint => AuthenticityBallot) private ballots;
    function add_ballot(uint _genesisFunding, uint _hash, uint32 _commitEnd, uint _revealEnd) external payable {
        require(_hash != 0, "Invalid hash.");
        require(ballots[_hash].exists == false, "Balloting has already begun");
        require(_commitEnd - block.timestamp >= 10 minutes, "Length of commitment period must be at least 10 minutes");
        require(_revealEnd - _commitEnd >= 10 minutes, "Length of commitment period must be at least 10 minutes");

    }
}

